module.exports = {
  path: "/elevator",
  name: "智能电梯",
  meta: {
    title: "智能电梯",
  },
  component: () => import("./index"),
  children: [
    {
      path: "/elevator",
      name: "通行记录",
      meta: {
        title: "通行记录",
        nav: true,
      },
      component: () => import("./log"),
    },
    {
      path: "/elevator/manage",
      name: "电梯管理",
      meta: {
        title: "电梯管理",
        nav: true,
      },
      component: () => import("./manage"),
    },
  ],
};
